package adt;import entity.Tutor;import java.util.Iterator;/** * * @author zhinf */public interface ListInterface<T> {      Iterator<T> getIterator();     public boolean add(T newEntry);  public boolean add(int newPosition, T newEntry);  public T remove(int givenPosition);  public void clear();   public boolean replace(int givenPosition, T newEntry);    public T getEntry(int givenPosition);   public T find(T criteria);    public int getNumberOfEntries();   public boolean isEmpty();  public boolean isFull();}